import React, { useState } from "react";
import "../Signin/Signin.css";
import "./Signup.css";
import Navbar1 from "../Navbar/Navbar";
import Modal from "../Modal/Modal";
import { createPortal } from "react-dom";

function Signup() {
  const [modalOpen, setModalOpen] = useState(false);
  const [message, setMessage] = useState("");
  const [formData, setFormData] = useState({
    name: "",
    username: "",
    email: "",
    password: "",
    cpass: "",
  });

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleButtonClick = (value) => {
    setModalOpen(false);
    setMessage(value);
  };

  const handleFormSubmit = (event) => {
    event.preventDefault();
    // Validate form data if needed
    setModalOpen(true);
    console.log(formData);
  };

  return (
    <div className="signin-bg">
      <br />
      <Navbar1 />
      <div className="signup-box">
        <h1 className="form">
          <div className="waviy" style={{ color: "#75006f" }}>
            <span style={{ "--i": 1 }}>S</span>
            <span style={{ "--i": 2 }}>i</span>
            <span style={{ "--i": 3 }}>g</span>
            <span style={{ "--i": 4 }}>n</span>
            &nbsp;
            <span style={{ "--i": 5 }}>U</span>
            <span style={{ "--i": 6 }}>p</span>
          </div>
        </h1>
        <div className="line"></div>
        <br />
        <form onSubmit={handleFormSubmit}>
          <div className="signin-inputbox">
            <input
              className="signin-input"
              type="text"
              name="name"
              required="required"
              value={formData.name}
              onChange={handleInputChange}
            />
            <span>Name</span>
          </div>
          <br />
          <div className="signin-inputbox">
            <input
              className="signin-input"
              type="text"
              name="username"
              required="required"
              value={formData.username}
              onChange={handleInputChange}
            />
            <span>Username</span>
          </div>
          <br />
          <div className="signin-inputbox">
            <input
              className="signin-input"
              type="text"
              name="email"
              required="required"
              value={formData.email}
              onChange={handleInputChange}
            />
            <span>Email</span>
          </div>
          <br />
          <div className="signin-inputbox">
            <input
              className="signin-input"
              type="password"
              name="password"
              required="required"
              value={formData.password}
              onChange={handleInputChange}
            />
            <span>Password</span>
          </div>
          <br />
          <div className="signin-inputbox">
            <input
              className="signin-input"
              type="password"
              name="cpass"
              required="required"
              value={formData.cpass}
              onChange={handleInputChange}
            />
            <span>Confirm Password</span>
          </div>
          <br />
          <center>
            <button className="signin-button" type="submit">
              Sign up
            </button>
          </center>
        </form>
        <br />
        <div style={{ color: "black", fontSize: "20px" }}>
          Having an account already?{" "}
          <a href="/" style={{ color: "#75006f", textDecoration: "none" }}>
            Log in
          </a>{" "}
          Here
        </div>
        {modalOpen &&
          createPortal(
            <Modal closeModal={handleButtonClick}>
              <h1>This is a modal</h1>
              <br />
              <p>This is the modal description</p>
              <button
                className="btn btn-submit"
                onClick={() => handleButtonClick("Submit button was clicked")}
              >
                Submit
              </button>
              <button
                className="btn btn-cancel"
                onClick={() => handleButtonClick("Cancel button was clicked")}
              >
                Cancel
              </button>
            </Modal>,
            document.body
          )}
      </div>
    </div>
  );
}

export default Signup;
